import{_ as r,c as o,al as t,o as i}from"./chunks/framework.NFAqBSgQ.js";const d=JSON.parse('{"title":"Microchip pic32mx","description":"","frontmatter":{},"headers":[],"relativePath":"en/platforms/mips/pic32mx/index.md","filePath":"en/platforms/mips/pic32mx/index.md"}'),a={name:"en/platforms/mips/pic32mx/index.md"};function h(c,e,n,p,s,l){return i(),o("div",null,e[0]||(e[0]=[t('<h1 id="microchip-pic32mx" tabindex="-1">Microchip pic32mx <a class="header-anchor" href="#microchip-pic32mx" aria-label="Permalink to &quot;Microchip pic32mx&quot;">​</a></h1><p>(MIPS M4K architecture)</p><h2 id="microchip-pic32mx2xx" tabindex="-1">Microchip PIC32MX2xx <a class="header-anchor" href="#microchip-pic32mx2xx" aria-label="Permalink to &quot;Microchip PIC32MX2xx&quot;">​</a></h2><p>A port is in progress from the DTX1-4000L &quot;Mirtoo&quot; module from <a href="http://www.dimitech.com/" target="_blank" rel="noreferrer">Dimitech</a>. This module uses Microchip PIC32MX250F128D and the Dimitech DTX1-4000L EV-kit1 V2. See the <a href="http://www.dimitech.com/" target="_blank" rel="noreferrer">Dimitech</a> website for further information.</p><h2 id="microchip-pic32mx4xx" tabindex="-1">Microchip PIC32MX4xx <a class="header-anchor" href="#microchip-pic32mx4xx" aria-label="Permalink to &quot;Microchip PIC32MX4xx&quot;">​</a></h2><p><strong>PIC32MX440F512H</strong>. This port uses the &quot;Advanced USB Storage Demo Board,&quot; Model DB-DP11215, from <a href="http://www.sureelectronics.net" target="_blank" rel="noreferrer">Sure Electronics</a>. This board features the Microchip PIC32MX440F512H.</p><p><strong>PIC32MX460F512L</strong>. There one two board ports using this chip:</p><ul><li><strong>PIC32MX Board from PCB Logic Design Co</strong>. This port is for the PIC32MX board from PCB Logic Design Co. and used the PIC32MX460F512L. The board is a very simple -- little more than a carrier for the PIC32 MCU plus voltage regulation, debug interface, and an OTG connector.</li><li><strong>UBW32 Board from Sparkfun</strong> This is the port to the Sparkfun UBW32 board. This port uses the <a href="http://www.sparkfun.com/products/8971" target="_blank" rel="noreferrer">original v2.5</a> board which is based on the Microchip PIC32MX460F512L. This older version has been replaced with this <a href="http://www.sparkfun.com/products/9713" target="_blank" rel="noreferrer">newer board</a>. See also the <a href="http://www.schmalzhaus.com/UBW32/" target="_blank" rel="noreferrer">UBW32</a> web site.</li></ul><h2 id="microchip-pic32mx7xx" tabindex="-1">Microchip PIC32MX7xx <a class="header-anchor" href="#microchip-pic32mx7xx" aria-label="Permalink to &quot;Microchip PIC32MX7xx&quot;">​</a></h2><p>PIC32MX795F512L. There one two board ports using this chip:</p><ul><li><strong>Microchip PIC32 Ethernet Starter Kit</strong>. This port uses the Microchip PIC32 Ethernet Starter Kit (DM320004) with the Expansion I/O board. See the <a href="http://www.microchip.com" target="_blank" rel="noreferrer">Microchip website</a> for further information.</li><li><strong>Mikroelektronika PIC32MX7 Mulitmedia Board (MMB)</strong>. A port has been completed for the Mikroelektronika PIC32MX7 Multimedia Board (MMB). See <a href="http://www.mikroe.com/" target="_blank" rel="noreferrer">http://www.mikroe.com/</a> for further information about this board.</li></ul><p><strong>Development Environment:</strong> These ports uses either:</p><ol><li>The <em>LITE</em> version of the PIC32MX toolchain available for download from the <a href="http://www.microchip.com" target="_blank" rel="noreferrer">Microchip</a> website, or</li><li>The Pinguino MIPS ELF toolchain available from the Pinguino <a href="https://code.google.com/archive/p/pinguino32/" target="_blank" rel="noreferrer">website</a>.</li><li>The MIPS SDE toolchain available from the <a href="http://www.mentor.com" target="_blank" rel="noreferrer">Mentor Graphics</a> website.</li></ol><h3 id="supported-boards" tabindex="-1">Supported Boards <a class="header-anchor" href="#supported-boards" aria-label="Permalink to &quot;Supported Boards&quot;">​</a></h3><blockquote><p>boards/<em>/</em></p></blockquote>',15)]))}const f=r(a,[["render",h]]);export{d as __pageData,f as default};
